import './newpage.css'

const NewsCard =({artical})=>{


    if(!artical.title) return  (null)
    return(
        <div className='authore'>

            <h2>{artical.title}</h2>
          <button>{artical.url}</button>
            <a href={artical.author}>  </a>

        </div>
    )

}
export default NewsCard
